import React from 'react'
import './ProjectCard.css'

const ProjectCard = ({ work, setOpenModal }) => {
  return (
    <div className='card1' onClick={() => setOpenModal({state: true, work: work})}>
       <img src={work?.image} />
       <div className='tags'>
        {
          work.tags?.map((works,index) =>(
            <span className='tag'>{works}</span>
          ))
        }
       </div>

       <div className='details'>
          <div className='title1'>{work?.title}</div>
          <div className='date1'>{work?.date}</div>
          <div className='description1'>{work?.description}</div>
       </div>
    </div>
  )
}

export default ProjectCard
